import React from "react";
import useRefExample from "../src/useRefExample";

const useRefEx = () => {
  return (
    <div>
      <useRefExample primaryPic="Hello" secondaryPic="Hello PP" />
      <br />
      <useRefExample primaryPic="Hi" secondaryPic="Hi SP" />
    </div>
  );
};

export default useRefEx;
